import logo from './logo.svg';
import './App.css';
import home from './webpages/home';
import login from './webpages/login';
import React, { useState } from 'react';

function App() {
  return (
    <BrowserRouter>
      <nav>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/login">About</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </nav>

      <Routes>
        <Route path="/" element={<home />} />
      </Routes>
    </BrowserRouter>
  );
}
export default App;
